import logo from './logo.svg';
import './App.css';
import Header from './Component/Header/Header';
import Sidebar from './Component/Sidebar/Sidebar';
import Videoes from './Component/Videoes/Videoes';
//import {BrowserRouter as Router, Switch, route} frome "react-router-dom";


function App() {
  return (
    <div className="App">
     <Header />

     <div className='main__display'>
      <Sidebar />

      <Videoes />
     </div>
    </div>
  );
}

export default App;
